#include <map>
#include <iostream>
#include <vector>
#include <unordered_set>
#include <cassert>
#include <string>
#include <algorithm>
#include <iostream>
#include <unordered_map>
#include <stack>
#include <numeric>
using std::vector;
using std::string;

class Solution {
public:
    vector<int> findAnagrams(const string& s, const string& p) {
        int tbp[26] = {0};
        for (auto ch: p) {
            tbp[ch - 'a']++;
        }

        int tbs[26] = {0};
        int start = 0;
        int end = 0;
        const int len = s.size();
        std::vector<int> ret;
        while (end <= len) {
            // end向右滑动
            for (; end < len; ++end) {
                tbs[s[end] - 'a']++;
                if (tbs[s[end] - 'a'] + 1 > tbp[s[end] - 'a']) {
                    break; 
                }
            }

            // 将start加入结果中
            if (end - start == int(p.size())) {
                ret.push_back(start);
            }

            // start向左滑动
            if (end == len) {
                break;
            }
            for (; start <= end && tbs[s[end] - 'a'] > tbp[s[end] - 'a']; ++start) {
                tbs[s[start] - 'a']--;
            }
            ++end;
        }
        return ret;
    }
};
int main() {
    std::string s = "";
    std::string p = "";
    auto ret = Solution().findAnagrams(s, p);
    for (auto x: ret) {
        std::cout << x << std::endl;
    }
    return 0;
}

